@Abdullah__Basra بكل الاحوال راح يصل شي ولو بسيط للمناطق المدمره . بخصوص الاموال مسروقه من حكومة الاحتلال يعني الصليب الاحمر الكويتي سرق حكومتك مثلاً؟
اما حكومة الكويت تسرق النفط العراقي ماكو هذا الكلام . اكو ابار مشتركه وهذا بحثاً اخر .
من الاخلاق ان نشكر كل شخص يدعمنه حتى لو بالكلام

